import React from "react";
import NavBarSearch from "./reusables/NavBarSearch";
import NavBarLogin from "./reusables/NavBarLogin";
import NavBarMenu from "./reusables/NavBarMenu";

const Navbar = () => {
  return (
    <div
      className="animated bounce delay-2s"
      style={{ display: "flex", height: "100px", justifyContent: "center" }}
    >
      <NavBarSearch />
      <NavBarMenu />
      <NavBarLogin />
    </div>
  );
};

export default Navbar;
